import React from 'react';

const NotaryCard = ({ notary }) => {
  return (
    <div className="notary-card" style={{ textDecoration: 'none', color: 'inherit' }} >
      <img src={notary.img} alt={notary.name} />
      <p>{notary.name} </p>
      <p>{notary.experience}</p>
    </div>
  );
};

export default NotaryCard;
